import '../src/styles/main.css';

import Header from './components/header';

function App() {
  return (
    <div className="App">
      <header className="bg-blue-300">
        <p>
          yalla.
        </p>
        <Header />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
